        function calculateMidpoint(coordinates) {
            var totalLat = 0;
            var totalLon = 0;
            // Sum up all latitude and longitude values
            coordinates.forEach(function(coord) {
                totalLat += coord[0];
                totalLon += coord[1];
            });
            // Calculate the average latitude and longitude
            var avgLat = totalLat / coordinates.length;
            var avgLon = totalLon / coordinates.length;
            return [avgLat, avgLon];
        }
        function calculatePolygonArea(coordinates) {
            var area = 0;
            for (var i = 0; i < coordinates.length; i++) {
                var j = (i + 1) % coordinates.length;
                area += coordinates[i][0] * coordinates[j][1];
                area -= coordinates[j][0] * coordinates[i][1];
            }
            area = Math.abs(area) / 2;
            return area *111000 * 111000;
        }
        var popupContent = `<p>${calculatePolygonArea(markerPositions)}</p>`;
        // Add popup to a specific position on the map
        L.popup({ maxWidth: 400 })//
            .setLatLng(calculateMidpoint(markerPositions))
            .setContent(popupContent)
            .openOn(map);
            
        // Add markers to the map for each position
        markerPositions.forEach(function(position) {
            L.marker(position).addTo(map);
